looker.plugins.visualizations.add({
    id: 'dj_arc_radar_chart',
    label: 'Demandjump radar chart',
    options: {
        title: {
            label: 'Title of chart',
            order: 1,
            section: 'Format',
            type: 'string',
            placeholder: 'Enter chart title here',
            hidden: false
        },

        showTitle: {
            label: 'Show title',
            order: 2,
            section: 'Format',
            type: 'boolean',
            default: true,
            hidden: false
        }
    },
    create: function(element, config) {
        element.innerHTML = `
            <div class="row">
                <div class="col-md-6">
                    <div class="main-card mb-3 card">
                        <div class="card-body">
                            <canvas id="radar-chart"></canvas>
                        </div>
                    </div>
                </div>
            </div>
            `;
    },
    updateAsync: function(data, element, config, queryResponse, details, doneRendering) {
        let node = document.getElementById('radar-chart');
        while(node.firstChild) node.firstChild.remove();
        console.log('These are the settings', this.options);
        console.log('This is the config', config);
        console.log('Queryresponse', queryResponse);
        console.log('Data', data);
        let datum = data;
        datum.forEach(row => {
            for(let i = 0; i < row.length; i++) {
                if (row[i].value == null) row[i] = 0;
            }
        });
        // console.log('Mutated data', datum);

        // Pull pivots inot dimension array
        if (queryResponse.fields.pivots.length != 0) {
            queryResponse.fields._dimension_like = queryResponse.fields.dimension_like;
            queryResponse.fields.dimension_like = queryResponse.fields.pivots;
        }


        let colors = [window.chartColors.red,window.chartColors.orange,window.chartColors.yellow,window.chartColors.green,window.chartColors.blue,'#4dc9f6','#f67019','#f53794','#537bc4','#acc236','#166a8f','#00a950','#58595b','#8549ba'];        
        let title = ' ';
        let showTitle = false;
        if (config.title) {
            if (config.showTitle) showTitle = config.showTitle;
            title = config.title;
        }

        let labels = [];
        let dataset = [];
        datum.forEach(row => {
            if (row[queryResponse.fields.dimension_like[0].name].rendered) labels.push(row[queryResponse.fields.dimension_like[0].name].rendered);
            else labels.push(row[queryResponse.fields.dimension_like[0].name].value);
            
            dataset.push(row[queryResponse.fields.measure_like[0].name].value);
        });



        let configRadar = {
            type: 'radar',
            data: {
                labels: labels,
                datasets: [{
                    label: queryResponse.fields.dimension_like[0].label,
                    backgroundColor: color(colors[5]).alpha(0.2).rgbString(),
                    borderColor: colors[5],
                    pointBackgroundColor: colors[5],
                    data: dataset
                }]
            },
            options: {
                responsive: true,
                maintainAspectRatio: false,
                legend: {
                    position: 'top',
                },
                title: {
                    display: showTitle,
                    text: title
                },
                scale: {
                    ticks: {
                        beginAtZero: true
                    }
                }
            }
        };
        
        
        // Apex Charts
        window.Apex = {
            dataLabels: {enabled: false},
            stroke: {width: 2}
        };

        // Radar Chart Init
        if (document.getElementById('radar-chart')) {
            window.myRadar = new Chart(document.getElementById('radar-chart'), configRadar);
        }
        /**************** Done! *****************/
        doneRendering(); 
    }
});























